    "id": 34,
    "nombre": "Roberto Rodriguez",
    "descripcion": "El gallego Roberto Rodríguez, tetracampeón de la Liga Nacional de Fuerza ha ganado la primera de las cuatro pruebas de la competición, por lo que busca hacerse con el premio una quinta vez, ya sea arrastrando un camión o volteando un coche. Nada se le resiste.  Con 1,85 metros de altura y unos 155 kilos de peso, el hombre más fuerte de España es capaz de levantar 360 kilos en peso muerto, 320 en sentadilla o 255 kilogramos en press banca, sin embargo, su especialidad es levantar piedras de 600 kilos o neumáticos de 573 kilos, correr con maletines de acero de 400 kilos, levantar coches o arrastrar camiones.   Fue un campeonato duro, no me esperé tanta competencia , ha indicado Rodríguez a Antena 3 Deportes,  por espectáculo y por calentar, hacemos una tirada de camión , prueba que consiste en arrastrar un camión de 13,5 toneladas a lo largo de 20 metros en un tiempo máximo de 90 segundos.  La segunda prueba, el  Paseo del granjero , consistía en arrastrar la mayor distancia posible dos artefactos de 140 kg cada uno en 60 segundos. La tercera prueba, el lanzamiento de la Bola LNF, consiste en la clásica prueba de lanzar una bola de 12,3 kg, de la que admite  parece que no, pero esos 12 kilos pesan .  Posteriormente, la cuarta prueba, la de  aguante frontal , consistía en mantener con ambas manos un barril de 24 kilogramos el mayor tiempo posible. Y, como colofón de esta primera fase, la prueba  Combinada con vuelvo de coche , en la cual cada competidor debe recorrer 20 metros con un eje diferencial trasero de Furgoneta en las manos (124 kg) en el menor tiempo posible, para posteriormente volcar un automóvil de unos 900 kg de peso, en un tiempo total de 90 segundos.  El vigués espera revalidar su título como  El hombre más fuerte de España  y demostrar que no es como el resto de humanos.",
