    "descripcion": "James Preston Rogers nació en Toronto, Ontario, Canadá, hijo de Sandra y Robert Rogers, quienes no tenían idea de que sería el talento más grande que la vida en el que se ha convertido. James fue un atleta durante toda la escuela secundaria y la universidad, pero encontró su verdadera vocación cuando se presentó a una audición para un comercial nacional sin una foto en la cabeza, un currículum o un agente y reservó el papel. James se dio cuenta de que había estado buscando una salida para sus pasiones creativas y emprendió una carrera como actor. James encontró el éxito en los comerciales y el escenario local, y fue entonces cuando la WWE se acercó a él para que fuera un luchador estrella para ellos. James saltó al ring con ambos pies y pronto se convertiría en una estrella importante para la WWE, pero justo después de pasar a la lucha libre profesional, James hizo una audición y obtuvo el papel de 'Bjorn'. en la película Outlander junto a Ron Pearlman y Jim Caviezel, después de eso James tuvo una serie de papeles protagónicos, incluido Sea of ​​Change junto a Tom Selleck, y la película independiente Poker Nights. La WWE vio hacia dónde se dirigía la carrera de James y gentilmente dejó que James terminara su contrato para que pudiera dedicarse por completo a la actuación. James protagonizó Pixels junto a Adam Sandler y Kevin James, volvió a aparecer en la serie dramática Crash & Burn y en la serie de comedia Walk the Prank, y fue estrella invitada en la exitosa serie Reign. Recientemente, James protagonizó la serie de Netflix aclamada por la crítica, Frontier, junto a Jason Momoa y Alun Armstrong. Recientemente, James Preston Rogers se ha convertido en un habitual para los espectadores recurrentes en la exitosa serie Mayans MC junto a Robert Patrick, recurrente en la serie de HBO The Righteous Gemstones junto a John Goodman, como invitado en Leverage y prestando su talento a Love, Death, & Robots. James protagoniza la película de Al Yankovic Weird: The Al Yankovic Story como Hulk Hogan junto a Daniel Radcliff, y junto a Eddie Murphy en la nueva película de Beverly Hills Cop. Con 6'6\" y musculoso corpulento, James se destaca entre la multitud tanto literal como figurativamente, y su talento actoral es aún mayor. James ha formado vínculos duraderos con Ron Perlman, Donnie Wahlberg y Aidan Devine. La actuación de James en Sea of Change dejó a Tom Selleck con tal impresión, que Tom seleccionó una escena con James y habló de él durante una entrevista en el programa 'Live with Regis & Kelly'.",
