    "nombre": "Daniel Singh",
    "descripcion": "Acertadamente apodado \"Guerrero\", la historia de vida de Daniel Singh es una historia heroica en sí misma. Nacido en Durham, Inglaterra, Singh jugó al rugby durante 2001 a la edad de 14 años. Fue entonces cuando sufrió una fractura en el cuello que le provocó parálisis. A pesar de no tener garantías de recuperar alguna movilidad, Singh se comprometió con un programa de rehabilitación de 8 meses que fue recompensado con la recuperación total de su lesión. Aunque móvil una vez más, Singh fue víctima de otro obstáculo plagado en forma de obesidad. Con inmensa determinación y dedicación, Singh comenzó a hacer ejercicio saludable a través del baloncesto y el levantamiento de pesas. Pasó 3 o 4 años trabajando en gimnasios y obtuvo muchas calificaciones durante ese tiempo. Alrededor de los 20 años en 2007, Singh comenzó una carrera en la lucha libre profesional. habiendo entrenado con gente como Elix Skipper y Mr. Hughes. También se puso en contacto con Sky 1 para un papel en la reactivación de la serie Gladiators. Inicialmente, fue asignado como reservista, con el nombre artístico de \"Trueno\", antes de unirse a la serie de 2008, donde apareció bajo el nombre artístico de \"Guerrero\". Con una altura impresionante y atlética de 6'3 \"y un peso estricto de 238 libras (o 17 piedras), Singh se destacó en las competencias de Puente Colgante y Terremoto del programa. Durante 2010, firmó un contrato de desarrollo con World Wrestling Entertainment. Después de un año, él regresó a su hogar en el Reino Unido, donde continuó luchando durante el resto de noviembre de 2011. En su hogar en el Reino Unido, Singh firmó con la promoción de MMA Super Fight League (SFL) para competir como peso pesado (265 libras). La competencia de lucha libre profesional y artes marciales mixtas fue solo la punta del iceberg para este guerrero. En 2014, Singh hizo su debut como actor en la serie dramática de acción 24: Live Another Day. Fiel a su apodo, el espíritu guerrero de Singh ejemplifica las recompensas de la determinación y la dedicación para lograr cualquier objetivo que se proponga.",
