    "id": 86,
    "nombre": "Erko Jun",
    "descripcion": "Nació en Bosnia y Herzegovina en Janja , pero con tan solo 2 años abandonó su hogar con sus padres como consecuencia de la Guerra de Bosnia (1992 ). La familia emigró a Bélgica , comenzando una nueva vida en Amberes . Erko comenzó a desarrollar un amor por los deportes de contacto que compartía con su padre. Durante una de las sesiones de entrenamiento, resultó gravemente herido y perdió la sensibilidad en la pierna derecha, desde las rodillas hasta los dedos de los pies. El médico le informó que nunca recuperaría el uso completo de su pierna derecha. Tras la tragedia, se derrumbó al enterarse de sus problemas de salud. No terminó ahí, comenzaron sus problemas familiares. Se metía en peleas callejeras. Bill Richardson le dio una mano amiga. Persuadió a Erko para que visitara el gimnasio, entrenara, mejorara su condición física y perfeccionara sus habilidades. Funcionó, seis meses de rehabilitación dieron resultados. Tuvo un comienzo difícil en la vida. Fue solo su pasión por las MMA y el entrenamiento lo que cambió su forma de percibir el mundo. El competidor de UFD Gym comenzó su aventura con el deporte entrenando taekwondo , boxeo tailandés y kickboxing , para luego enfocarse en los deportes de fuerza. Erko es tres veces campeón de culturismo junior , subcampeón de los Balcanes en culturismo y ganador del 3er lugar en el Musclemania Show en Miami. Entrena con el campeón de peso welter de KSW a diario .Roberto Soldic , y desde hace tiempo tenía la intención de probar suerte en una nueva disciplina. Erko Jun y Robocop no solo están conectados por un tapete común, sino también por su origen. Ambos nacieron en Bosnia , de donde huyeron con sus familias en busca de una vida mejor [4] ",
