    "nombre": "Masato Irie (入江 正登)",
    "descripcion": "IIrie Masato - 入江 正登 (nacido el 15 de julio de 1988) es un ex luchador de sumo profesional japonés de Mizumaki, Fukuoka. Hizo su debut en mayo de 2011 y luchó por última vez para el establo Tamanoi. Su rango más alto fue makushita 3 y se retiró en septiembre de 2019.\n\nDesde que era niño, a Irie le encantaba comer y llegó a ser más grande que sus compañeros de clase. Durante el primer grado, se unió a un club de judo local por recomendación de sus padres. Más tarde conoció el sumo y practicó sumo y judo simultáneamente hasta llegar a la escuela secundaria Kibogaoka, donde se centró únicamente en el sumo. Después de graduarse de la escuela secundaria, se matriculó en el Instituto de Ciencias de la Información de Kyushu y logró buenos resultados a nivel nacional, a pesar de luchar por una escuela pequeña. Después de graduarse de la universidad, optó por hacerse profesional y se unió al establo Tamanoi.\n\n\nANUNCIO\nANUNCIO\nCarrera\nIrie hizo su debut profesional en mayo de 2011 y registró un sólido récord de 6-1 en su primer torneo. Fue ascendido a sandanme en noviembre de 2011 y a makushita en mayo de 2012. Ascendió de rango a un ritmo constante y alcanzó el puesto 3 en makushita en noviembre de 2003. En julio de 2015, se lesionó la rodilla derecha y se perdió tres torneos, lo que le provocó que volviera a caer sobre sandanme. Regresó al sumo en enero de 2016, pero tuvo problemas para regresar a las filas superiores de makushita. Se retiró del sumo en septiembre de 2019.\n\nEstilo de lucha\nEl estilo de lucha de Irie\nIrie derrota a Keitenkai por oshidashi (empuje)\nVER IMAGEN\n\nIrie dominaba las técnicas de yotsu-sumo (lucha) y oshi-sumo (empujar y empujar). Su agarre favorito sobre el mawashi de su oponente era migi-yotsu, una posición con la mano izquierda afuera y la mano derecha adentro. Su kimarite ganadora más utilizada fue oshidashi (empujar), seguida de yorikiri (forzar).\n",
