    "descri_p": "Project Scard describe los encuentros y batallas de aquellos que tienen tatuajes que poseen los poderes sellados de las bestias divinas y los dioses. La historia se desarrolla en la Zona Especial de Akatsuki, una zona sin ley en Tokio. \"Helios\" son aquellos que utilizan la capacidad de los tatuajes para proteger la ciudad, \"Artemis\" se compromete a mantener la seguridad y el control, aunque tiene un fuerte motivo comercial, y el \"Servicio Especial de Seguridad Pública\" es el personal de Scard de la policía metropolitana. Departamento. Viven los días turbulentos para seguir adelante."
