    "descripcion": "En el pasado, los países \"Kantō\" y \"Kansai\" entraron en guerra y dividieron el mundo. Tras acabar la guerra, Kansai se convirtió en un país vasallo de Kantō. La policía y el gobierno de Kansai se han degradado con los años y el crimen campa a sus anchas. Estos nuevos criminales son conocidos como \"Akudama\". La historia sigue a un grupo de \"Akudama\", quienes reciben un mensaje de un cliente anónimo para liberar a un prisionero, condenado a muerte, llamado, Asesino, antes de ser ejecutado. Sin embargo, una vez que logran completar esto, descubren que el trabajo era parte de un plan más amplio de su cliente para hacerlos trabajar juntos en un trabajo mucho más grande y peligroso: infiltrarse en el Shinkansen y robar la valiosa carga de una bóveda en la parte delantera del tren. Por lo tanto, el equipo debe trabajar en conjunto para terminar el trabajo y ganar su gran paga, mientras se mantienen por delante, huyendo de los Ejecutores (especializados en cazar \"Akudama\") de la Policía de Kansai detrás de ellos.",
