    "nombre": "William McGregor Paxton",
    "descripcion": " Pintor estadounidense nacido en Baltimore, Maryland. A mediados del año 1870 su familia se mudó a Newton Corner, Massachusetts, donde James, el padre de William, se estableció como despensero. A los 18 años ganó una beca para asistir a la Cowles Art School, donde empezó sus estudios de Arte con Dennis Miller Bunker. Después estudió con Jean-Léon Gérôme en París y, a su regreso a Boston, con Joseph DeCamp en Cowles. Paxton, que es más conocido como pintor de retratos, enseñó en la Escuela del Museo desde 1906 a 1913, y junto con otros artistas muy conocidos de la época, incluyendo a Edmund Charles Tarbell y Frank Weston Benson, cofundó The Guild of Boston Artists, identificándose con la Escuela de Boston. Fue muy conocido por su atención extraordinaria en los efectos de luz y los detalles en la piel y las telas. Sus composiciones fueron a menudo de mujeres jóvenes en bellos interiores. Ganó fama por su arte de retratista, pintando a los presidentes Grover Cleveland y Calvin Coolidge. Como muchos de sus colegas de Boston, encontró inspiración en las obras del pintor holandés del siglo XVII Johannes Vermeer. Se sintió fascinado no sólo con la imaginación de Vermeer, sino también con el sistema de ópticas que empleaba. Estudió las obras de Vermeer cuidadosamente, y descubrió que sólo un área en sus composiciones estaba completamente enfocada, mientras que el resto ligeramente manchada. Empezó a emplear dicho sistema en su propio trabajo, incluyendo The New Necklace, donde sólo las cuentas de oro están ampliamente definidas mientras el resto de los objetos en la composición tienen bordes más suaves, más borrosos. Este efecto es aun más notable en su pintura de 1915 titulada Nude, que muestra a una mujer joven sentada con un vestido azul que se extiende por el asiento de un diván sin respaldo. La mujer es mostrada apoyándose ligeramente a la derecha, alcanzando a verse una prenda interior rosa. Todos los objetos en la pintura están ligeramente manchados, con excepción de un pecho visible de la mujer y partes de su brazo derecho. Paxton estaba trabajando en su última pintura, una vista de su living room en 19 Montvale Road, con su esposa posando para él, cuando sufrió un ataque al corazón, falleciendo a la edad de 72 años.  © Renato Gómez Vignes",
    "imagen": "articulillos/ima/uploadsimagen\\COSAS_INTERESANTES\\art.jpeg",
    "genero": "BUSCAR",
    "departamento": 1003,
