    "descripcion": "El Escuadrón Suicida (en inglés Suicide Squad) es el nombre de un equipo ficticio de supervillanos que aparece en los cómics estadounidenses publicados por DC Comics. La primera versión de Escuadrón Suicida debutó en The Brave and the Bold # 25 (septiembre de 1959) y la segunda versión moderna, creada por John Ostrander, debutó en Legends # 3 (enero de 1987). Uno de los dos equipos salva al mundo de una amenazante carrera de salvajes.  La encarnación moderna del Escuadrón Suicida es la Fuerza Especial X, un equipo de supervillanos encarcelados que realizan misiones secretas a cambio de penas de prisión reducidas. El nombre del Escuadrón Suicida alude a la naturaleza peligrosa de sus misiones. El equipo tiene su base en la Penitenciaría Belle Reve bajo la dirección de Amanda Waller.  Varias encarnaciones del Escuadrón Suicida han existido a lo largo de los años, como se muestra en varias series de cómics homónimo, desde sus orígenes en la Edad de plata hasta su reimaginación actual posterior a la crisis, a la versión actual que se introdujo en 2016 en Reinicio de DC reinicio de continuidad. La encarnación actual del equipo aparece en el quinto volumen de la serie de cómics Suicide Squad, y los miembros recurrentes incluyen Capitán Bumerang, Deadshot, Encantadora, Harley Quinn, Katana y Killer Croc.  El grupo ha aparecido en varias adaptaciones, incluidas series de televisión y un largometraje homónimo de 2016.",
