    "id": 2524,
    "nombre": "Giambattista Basile",
    "descripcion": "Cuando hablamos de cuentos de hadas tradicionales, todos pensamos enseguida en los hermanos Grimm o en Charles Perrault, autores conocidos en todo el mundo y cuya labor de recopilación es considerada canónica. Pero mucho antes de que Perrault juntara sus primeras historias o los Grimm recorrieran Alemania buscando cuentos, un brillante poeta napolitano ya había hecho la primera gran recopilación de relatos tradicionales: el Pentamerón.   Giambattista Basile nació en 1575 en la zona de Nápoles y a lo largo de su vida sirvió como militar para varios príncipes, incluyendo a uno de los hombres más poderosos de la Italia renacentista, el dogo de Venecia. Fue en esta ciudad donde Basile se aficionó a la escritura, concretamente a la poesía.  De vuelta a Nápoles, y alejado ya del mundo militar, Basile pudo dedicarse por completo a escribir. Su gran obsesión era poner por escrito los cuentos que había escuchado a lo largo de sus viajes por aquella convulsa Europa. Era un hombre muy viajado, ya que su trabajo como soldado le había llevado de uno a otro confín del continente.  El resultado fue un libro singular, el Pentamerón, también llamado Lo cunto de li cunti overo lo trattenemiento de peccerille (El cuento de los cuentos o el entrenamiento de los pequeños), que Basile escribió en dialecto napolitano. Fue la obra de su vida, cinco tomos que, al final, fueron publicados de manera póstuma de 1634 a 1636, gracias a la labor de edición final de su hermana.  Basile adaptó las obras que había escuchado a su estilo narrativo, ya que su labor no era la de un recopilador o un filólogo interesado en la transmisión oral de los cuentos, sino que buscaba crear sus propios cuentos a partir de la base tradicional. El Pentamerón contiene 50 cuentos contados durante 5 días, siguiendo la estela de otro gran libro de la época, el Decamerón.  Los cuentos que Basile incluyó en su libro suponen la versión más antigua por escrito de algunos de los relatos que más tarde se harían inmortales gracias a otros autores, como, por ejemplo, La Cenicienta, El gato con botas, Hansel y Gretel o Rapunzel.  El Pentamerón, sin embargo, no fue una obra muy conocida en su época. Tanto el uso del dialecto napolitano como la edición limitada hicieron que solo unos pocos estudiosos tuvieran acceso a este libro, entre ellos los hermanos Grimm, que así lo señalaron en su propia obra. Entrado ya el siglo XIX, la obra de Basile fue recuperada y hoy en día ha sido traducida a numerosos idiomas  <h3> Libros</h3> Pentamerón</br>  Sol, Luna y Talía</br>  El cuento de los cuentos</br>  La Gata Cecicienta</br>  Petrosinella: un cuento napolitano</br>  La pulga</br>  Cagliuso </br> La cierva encantada</br>  Il racconto dei racconti</br>  Nenillo y Nenella</br>  La esclavita</br>  Peruonto</br>  La gata cenicienta y otras fábulas de  lo cunto de li cunti </br>  Der Pentamerone, Oder, Das Marchen Aller Marchen - Scholar s Choice Edition</br>  El cuento del ogro</br>  Penta, la de las manos cortadas</br>  El mirto</br>  Verde pasto</br>  Esmalte esplendoroso</br>  La serpiente</br>  Italienische Märchen.</br>  Viola</br>  Las dos tortitas</br>  Corvetto</br>  El dragón</br>  The Three Sisters</br>  El ignorante</br>  La vecchia scortecata</br>  Los cinco hijos</br>  Las tres coronas</br>  El mercader</br> 1634</br> La paloma</br>  La soberbia castigada</br>  Los meses</br>  La plantación de ajos</br>  Los siete pichones</br>  El escarabajo, el roedor y el grillo</br>  El cuervo </br> Fiabe </br> Antuono </br> La piedra del gallo </br> Cara de cabra </br>  El rostro",
    "imagen": "articulillos/ima/uploadsimagen\\ima0\\05.jpg",
    "genero": "",
    "departamento": 1010,
    "articulocol": null,
