    "id": 2911,
    "nombre": "Henrete Ronner Knip",
    "descripcion": "Henriëtte Ronner-Knip (Ámsterdam, 31 de mayo de 1821 - Ixelles, 2 de marzo de 1909) fue una pintora neerlandesa-belga de estilo romántico conocida fundamentalmente por sus pinturas de animales y, en particular, de gatos.<br/>\r\nNació en Ámsterdam en una familia de artistas, recibiendo sus primeras lecciones de pintura de su padre Josephus Augustus Knip a la edad de 11 años. Algunas fuentes señalan que su madre era la también pintora de aves Pauline Rifer de Courcelles, que fue la primera esposa del padre, aunque en el momento del nacimiento estaban separados y el padre vivía con su amante Cornelia van Leeuwen (1790–1848), a la que también se señala cómo madre de la artista.1​\r\n\r\nEl padre había viajado a París en 1801 donde estuvo pintando paisajes. Ganó el Premio de Roma en 1808 y pasó unos años en Italia desde 1809. Allí produjo dibujos de monumentos romanos.\r\n\r\nLa familia se trasladaba a menudo, y su padre consiguió trabajo dado clases. Pero, hacia 1823, se quedó ciego de un ojo. Al año siguiente se divorció definitivamente de Rifer de Courcelles y se casó con van Leeuwen. El padre perdió la vista en 1832, de modo que empezó a formar a su hija para que se encargara de mantener el sustento de la familia. Así que ella comenzó a trabajar rigurosamente en sus trabajos en el estudio de su padre a partir de 1835 y para 1840, cuando se asentaron en Berlicum, era ella quien estaba a cargo de los asuntos financieros y legales de la familia.2​ En 1938 participó en la Exposición de Maestros Vivos en Holanda en 1838.1​\r\n\r\nGradualmente comenzó a focalizarse en la temática de los animales. En 1845 sus obras estaban centradas en perros de caza en bosques o en campos.\r\n\r\nTras la muerte de van Leeuwen, se trasladó a Ámsterdam, donde se dedicó a pintar granjas, animales y bosques; primero con acuarelas y posteriormente al óleo. Ese mismo año (1848) fue admitida como miembro activo",
