    "nombre": "The Files of Young Kindaichi",
    "descripcion": "The Kindaichi Case Files ( japonés :金田一少年の事件簿, Hepburn : Kindaichi Shōnen no Jikenbo ) es una serie de manga de misterio japonesa basada en las aventuras de resolución de crímenes de un estudiante de secundaria, Hajime Kindaichi, el supuesto nieto del famoso (ficticio) El detective privado Kosuke Kindaichi . Escrita por Yōzaburō Kanari o Seimaru Amagi (según la serie) e ilustrada por Fumiya Satō , la serie Kindaichi se serializó enla revista de manga shōnen Weekly Shōnen Magazine de Kodansha desde octubre de 1992 hasta octubre de 2017, abarcando un total de 76 volúmenes de tankōbon . Es una de las primeras obras del género manga de misterio. En Norteamérica, la serie fue publicada en inglés por Tokyopop con el título The Kindaichi Case Files . Tokyopop solo publicó los primeros 17 volúmenes (la primera serie).",
